ï»¿var App = App || {};

App.location = App.location || {};
App.location.search = {};

App.location.search.browserApi = function () {

    function geocode(success, error) {
        
        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(function (position) {
                
                var coordinates = {
                    lat: position.coords.latitude,
                    lng: position.coords.longitude
                };

                success(coordinates);
                
            }, error);
        }
    }

    return {
        geocode: geocode
    };
}();

App.location.search.googleApi = function () {
    
    function geocode(address, success, err) {

        var geocoder = new google.maps.Geocoder();

        geocoder.geocode({ 'address': address }, function (results, status) {

            if (status == google.maps.GeocoderStatus.OK) {
                var result = results[0].geometry.location;
                success({ lat: result.lat(), lng: result.lng() });
            } else {
                err();
            }
        });
    }

    return {
        geocode: geocode
    };
}();

App.location.search.controller = function() {

    var resultsUrl = App.rootUrl + "locations/nearby?lat={lat}&lng={lng}&geocode=true";

    function onGeoSuccess(coordinates) {

        window.location.href = resultsUrl
            .replace("{lat}", coordinates.lat)
            .replace("{lng}", coordinates.lng);
    }

    function onGeoError() {
        console.log("error");
    }

    function init() {

        $('#useCurrentLocation, #location-search-crosshairs').on('click', function (e) {
            e.preventDefault();

            App.location.search.browserApi.geocode(onGeoSuccess, onGeoError);

            return false;
        });

        $('a.locations-all-state').on('click', function (e) {
            var bookmark = $(this).attr("data-bookmark");

            $('body, html').animate({
                'scrollTop': $("div[data-bookmark='" + bookmark + "']:visible:first").offset().top
            }, 2000);
        });

        $('.locations-search-button').on('click', function (e) {
            e.preventDefault();
            var address = $(".locations-search-address:visible:first").val();
            App.location.search.googleApi.geocode(address, onGeoSuccess, onGeoError);
        });

        $('input.locations-search-address').keypress(function (e) {
            if (e.which == 13) {
                var address = $(this).val();
                App.location.search.googleApi.geocode(address, onGeoSuccess, onGeoError);
            }
        });
        
        $('#search-form').on('submit', function (e) {
            e.preventDefault();            
            var address = $('#address').val();
            App.location.search.googleApi.geocode(address, onGeoSuccess, onGeoError);

            return false;
        });

        $('.top').on('click', function (e) {
		    e.preventDefault();

		    $('body, html').animate({
			    'scrollTop': 0
		    }, 500);

		    return false;
	    });
    }

    return {
        init: init,
    };
}();

App.LocationMap = (function ($) {
    var image;
    var latitude;
    var longitude;

    function init(img, lat, lng) {
        image = img;
        latitude = lat;
        longitude = lng;

        google.maps.event.addDomListener(window, 'load', initializeMap);
    }

    function initializeMap() {

        var latlng = new google.maps.LatLng(latitude, longitude);

        var options = {
            zoom: 14,
            center: latlng,
            mapTypeId: google.maps.MapTypeId.ROADMAP
        };

        jQuery('.map-canvas').each(function (index, $map) {
            var map = new google.maps.Map($map, options);

            var marker = new google.maps.Marker({
                position: latlng,
                map: map,
                icon: image
            });

            var center;

            function calculateCenter() {
                center = map.getCenter();
            }

            google.maps.event.addDomListener(map, 'idle', function () {
                calculateCenter();
            });

            google.maps.event.addDomListener(window, 'resize', function () {
                map.setCenter(center);
            });
        });
    };

    return {
        init: init
    };
})();

